playstore_details.description:
Proteger o acesso à seu usuário GOL com o EasySolutions DetectID One Time Password App para Celular. GOL DetectID gera um token OTP (One-time Password) para permitir login seguro as aplicações integradas ao APP.  Pode ser configurado em segundos e protege os usuários e as empresas contra os riscos de roubo de senha e reutilização.

Características:
·         Fácil de instalar;
·         Fácil de configurar;
·         Suporte a OTP(One-time Password)
